

CREATE TABLE public.doenca
(
    id_doenca serial not null,
    doenca varchar(300)
);

CREATE TABLE public.paciente
(
    id_paciente serial not null,
    data_nasc date NOT NULL,
    sexo char not null,
    local_residencia varchar(500) not null,
    ocupacao varchar(30) not null,
    obito boolean NOT NULL,
    CONSTRAINT paciente_pk PRIMARY KEY (id_paciente)
);



CREATE TABLE public.atendimento
(
    id_atendimento serial,
    data_atendimento date NOT NULL,
    id_paciente integer NOT NULL
);


CREATE TABLE public.atendimento_doenca
(
    id_atendimento integer not null,
    id_doenca integer NOT NULL
);



